import React from 'react';
import './styles.scss';

const Home = () => {
    return(
        <section id='home' className='home'>

            <div className='home_text-wrapper'>
                <h1>
                    Hello, I'm Thiri May Thu
                    <br />
                    Junior Web Developer
                </h1>
            </div>

            <div className='home_contact-me'>
                <button>
                    Hire Me!
                </button>

            </div>

        </section>
    )
}

export default Home;
